import * as React from "react"
import Svg, { Rect, Defs, Pattern, Use, Image } from "react-native-svg"

function SvgComponent(props) {
  return (
    <Svg
      width={62}
      height={48}
      viewBox="0 0 62 48"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
      {...props}
    >
      <Rect width={62} height={48} rx={6} fill="url(#prefix__pattern0)" />
      <Rect
        x={0.5}
        y={0.5}
        width={61}
        height={47}
        rx={5.5}
        stroke="#000"
        strokeOpacity={0.35}
      />
      <Defs>
        <Pattern
          id="prefix__pattern0"
          patternContentUnits="objectBoundingBox"
          width={1}
          height={1}
        >
          <Use
            xlinkHref="#prefix__image0"
            transform="matrix(.004 0 0 .00517 0 -.146)"
          />
        </Pattern>
        <Image
          id="prefix__image0"
          width={250}
          height={250}
          xlinkHref="data:image/png;base64,"
        />
      </Defs>
    </Svg>
  )
}

export default SvgComponent
